import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';

import Schedule from './pages/Schedule';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Schedule />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
